import React from 'react'

export default function TaskRows(props) {
    return (
        <>
            <td>{props.name}</td>
            <td>{props.difficulty}</td>
            <td>{props.priority}</td>
            <td>{props.end_date}</td>
            <td><input type="checkbox" name="complete" value="complete"></input></td>
        </>
    )
}
